import { Breadcrumbs,Main } from "govuk-react";

function viewAppointment() {
    return(
        <div>
        <Main> 
    <Breadcrumbs>
  <Breadcrumbs.Link href="/section">
    Section
  </Breadcrumbs.Link>
  <Breadcrumbs.Link to="/section/sub-section">
    Sub-section
  </Breadcrumbs.Link>
  Current page
</Breadcrumbs>
</Main>   
        </div>
    );

}
export default viewAppointment;
